import React from 'react'

function AgeButton({age , incrementAge , children}) {
  console.log(`Render ${children} Button`);
  return (
    <>
    <button onClick={() => incrementAge}>{children}</button>
    <p>{age}</p>
    </>
  )
}

export default AgeButton
